// src/components/WeddingPlanning.js
import React from 'react';
import './WeddingPlanning.css';

const WeddingPlanning = () => {
    return (
        <div className="service-page">
            <h1>Wedding Planning</h1>
            <p>
                At WedSymphony, we specialize in creating the perfect wedding experience tailored to your unique preferences. Our expert planners guide you through every step of the wedding process, from the initial concept to the final day. Whether you envision a grand celebration or an intimate affair, we ensure every detail reflects your style and personality.
            </p>
            <p>
                Services include:
                <ul>
                    <li>Consultation and Theme Selection</li>
                    <li>Vendor Coordination</li>
                    <li>Timeline Management</li>
                    <li>Budgeting and Cost Control</li>
                    <li>Guest Management</li>
                </ul>
            </p>
            <p>
                Let us make your dream wedding a reality, full of unforgettable moments and lasting memories.
            </p>
        </div>
    );
}

export default WeddingPlanning;
